import { createStackNavigator } from 'react-navigation-stack';
import { createBottomTabNavigator} from 'react-navigation-tabs'
import { createAppContainer} from 'react-navigation'

import ScreensMenu from '../screens/additional/ScreensMenu';
import History from '../screens/additional/History';
import Settings from '../screens/additional/Settings';
import FlowRegulation from '../screens/FlowRegulation'


const AdditionalScreensNavigator = createStackNavigator({
    ScreensMenu: ScreensMenu,
    History: History,
    Settings: Settings
});

const BottomNavigator = createBottomTabNavigator({
    FlowRegulation: FlowRegulation,
    Menu: AdditionalScreensNavigator
});

export default createAppContainer(BottomNavigator);
